@ShahBalen बली प्रथा बन्द गरौँ 
हत्या हिंसा महापाप हो 
सारा चराचर जगत प्राणी देवी कै सन्तान हुन् भने कोइ आमा आफ्ना सन्तान का रगत खुशी हुन्छिन  त  त्यसैले बली प्रथा को नाम मा चले को हत्या हिंसा बन्द गरौँ र बेजुवान निर्दोष पशु पक्षी को संरक्षण गरौँ यहि नै मानव धर्म हो |

@ShahBalen बली प्रथा बन्द गरौँ 
हत्या हिंसा महापाप हो 
सारा चराचर प्राणी देवी का सन्तान हुन् र कुनै पनि आमा आफ्ना सन्तानको रगत खाएर खुशी हुदैनन त्यसैले बली प्रथा को नाममा चलाइएको हत्या हिंसा बन्द गरी बेजुवान निर्दोष पशु पक्षी को संरक्षण मा लागौं यहि नै मानव धर्म तथा कर्तब्य  हो |

@SherBDeuba बलिप्रथा_बन्द_गरौँ
देवी भागवतमा उल्लेख छ, “जिउँदो पशुलाई मारी पेट भर्नेले ७ जन्म खरायो, ७ जन्म माछा, तीन जन्म सुँगुर, ७ जन्म कुखुरा र पशु जुनी हुँदै सर्प, बिच्छी, आदि अनेकौँ जुनी प्राप्त गरेर कष्ट भोग्नुपर्छ।”
अधिक जानकारीका लागि पढ्नुहोस् -  ज्ञान गंगा। https://t.co/X8kQ1hciUC
